import React, {Component} from 'react'
import AppBar from '@material-ui/core/AppBar'
import MyToolbar from './myToolbar'
import MenuButton from './menuButton'
import AdminButton from './adminButton'


const myStyleL = {
	width:"50%",display:"flex",position:"relative",left:"0"
}
const myStyleR = {
	width:"50%",display:"flex",position:"relative",right:"0"
}

class Menu extends Component {
	render() {
		return (
			<AppBar>
				<MyToolbar>
					<div style={myStyleL}>
						<MenuButton />
					</div>
					<div style={myStyleR}>
						<AdminButton text="Registrieren" />
						<AdminButton text="Login" />
					</div>
				</MyToolbar>
			</AppBar>
		)
	}
}

export default Menu
